// Obtém os dados do nó Aggregate
const responseData = $item(0).$node["Aggregate"].json;

// Verifica se responseData é válido
if (!responseData || !responseData.data || !Array.isArray(responseData.data) || responseData.data.length === 0) {
    return [{ json: { error: "Nenhum dado válido encontrado na resposta." } }];
}

// Acessa a lista de posts dentro de data[0].data.items
const posts = responseData.data[0]?.data?.items || [];

// Verifica se posts é um array válido
if (!Array.isArray(posts) || posts.length === 0) {
    return [{ json: { error: "Nenhum post encontrado." } }];
}

const result = [];

for (const post of posts) {
    // Verifica se o post contém um carrossel (campo carousel_media deve existir e não estar vazio)
    if (!post.carousel_media || post.carousel_media.length === 0) {
        continue; // Ignora posts que não sejam carrossel
    }

    // Obtém ID do post (se estiver dentro de caption)
    const postId = post.caption?.id || "ID não encontrado";

    // Obtém o texto da postagem
    const postText = post.caption?.text || "Sem texto";

    // Obtém o nome do usuário
    const userName = post.caption?.user?.full_name || "Usuário desconhecido";

    // Extrai a URL principal de cada imagem do carrossel (corrigindo a duplicação)
    const imageUrls = post.carousel_media
        .map(media => media.image_versions?.items?.[0]?.url) // Pega apenas a primeira versão da imagem
        .filter(url => url); // Remove URLs vazias

    // Adiciona os dados ao resultado
    result.push({
        post_id: postId,
        text: postText,
        user: userName,
        images: imageUrls
    });
}

// Retorna os posts filtrados
return result.length > 0 ? result.map(post => ({ json: post })) : [{ json: { message: "Nenhum carrossel encontrado." } }];
